Synopsis
Blacked.com is proud to present the fourth installment of it's best-selling series. Starring in &quot;Black &amp; White Vol. 4,&quot; is a cast of beautiful women encountering their real first interracial experiences, including cover girl Abigail Mac! Curvaceous Abigail fulfills her ultimate fantasy with Flash Brown. Megan Rain is seduced by her classmate Jason Brown. Abella Danger rebounds from her ex by exploring her desires with Rob Piper and Jade Nile gets a pass from her husband, to experience Jason Brown. Filmed and directed by award winning director Greg Lansky. &quot;Black &amp; White Vol. 4&quot; is cinematic hardcore sex like you've never seen before!
